import React from 'react';
import Map from "mapmyindia-react";
import './App.css';



function App() {
    var lat=parseFloat(window.lat);
    var long=parseFloat(window.long);
    return (
      <Map
        markers={[
            { 
                position: [ lat, long],
                draggable: true, 
                title:"Am here!!",
            }
        ]}
        />

   );


}


export default App;
